'''
Your are given an array of positive integers nums.

Count and print the number of (contiguous) subarrays where the product of all the elements in the subarray is less than k.

Example 1:
Input: nums = [10, 5, 2, 6], k = 100
Output: 8
Explanation: The 8 subarrays that have product less than 100 are: [10], [5], [2], [6], [10, 5], [5, 2], [2, 6], [5, 2, 6].
Note that [10, 5, 2] is not included as the product of 100 is not strictly less than k.
Note:

0 < nums.length <= 50000.
0 < nums[i] < 1000.
0 <= k < 10^6.
'''
import time
import random
class Solution(object):
    def numSubarrayProductLessThanK2(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        # define a dictionary to store number of subarray +  product of subarrays for each ending
        # eg. [10, 5, 2, 6] dict[0] = {1: [10]}, dict[1] = {2: [50, 5]}, dict[2] = {2: [10, 2]}
        # the return will be sum of all dict keys
        if len(nums) == 0:
            return 0

        NumLessThanK = []
        if nums[0] < k:
            NumLessThanK.append([1, [nums[0]]])
        else:
            NumLessThanK.append([0, []])
        for i in range(1, len(nums)):
            tempNum = 0
            tempList = []
            if nums[i] == 1:
                tempNum = NumLessThanK[i-1][0]
                tempList = NumLessThanK[i-1][1][:]
            else:
                for each in NumLessThanK[i-1][1]:
                    if each * nums[i] < k:
                        tempNum += 1
                        tempList.append(each * nums[i])

            if nums[i] < k:
                tempList.append(nums[i])
                tempNum += 1
            NumLessThanK.append([tempNum, tempList])
        Total = 0
        for each in NumLessThanK:
            Total+=each[0]
        print (Total)
        return Total

    def numSubarrayProductLessThanK(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        # define a dictionary to store number of subarray +  product of subarrays for each ending
        # eg. [10, 5, 2, 6] dict[0] = {1: [10]}, dict[1] = {2: [50, 5]}, dict[2] = {2: [10, 2]}
        # the return will be sum of all dict keys
        if len(nums) == 0:
            return 0
        length = len(nums)
        product = []
        for i in range(0, length):
            temp = []
            for j in range(0, length):
                temp.append(k)
            product.append(temp)

        Total =0
        if nums[0] < k:
            product[0][0] = nums[0]
            Total += 1
        j = 1
        while j<length and nums[j] * product[0][j-1] < k:
            product[0][j] = nums[j] * product[0][j-1]
            j+=1
            Total += 1
        for i in range(1, length):
            for j in range(i, length):
                flag = False
                if j == i:
                    if nums[i] < k:
                        product[i][j] = nums[i]
                        Total+=1
                    else:
                        flat = True
                else:
                    if product[i][j-1] * nums[j] < k:
                        product[i][j] = product[i][j-1] * nums[j]
                        Total+=1
                    else:
                        flat = True
                if flag:
                    break

        return Total

